xe gần cổng ĐHNN','','#'),('Nhà gửi xe GĐ2','Nhà gửi xe gần giảng đường 2','','#'),('Nhà gửi xe Khoa Luật','Nhà gửi xe cạnh Khoa Luật','','#'),('Nhà gửi xe Thư viện','Nhà gửi xe gần thư viện','','#'),('Rubic 8','Rubic 8','','#'),('Sân bóng ĐHSP','Sân bóng ĐHSP','','#'),('Sân VĐ ĐHNN','Cung liên hợp thể thao Đại học Ngoại ngữ','Đây là sân bóng “chất” và sân tập thể dục đầy đủ tiện nghi. Có nhà đa năng, sân bóng rổ, bóng chuyền, cầu lông, tennis, bóng bàn…','https://www.facebook.com/media/set/?set=a.2239256642776421&type=3'),('Sunwah','Sunwah','','#'),('Thiên đường ẩm thực','Thiên đường ẩm thực','','#'),('Vườn nhãn trước G2','Vườn nhãn trước G2','Nơi đây chính là cái “tổ” lí tưởng để họp mặt Câu lạc bộ, tổ chức trò chơi, tập văn nghệ, ...','https://www.facebook.com/media/set/?set=a.2239256642776421&type=3'),('Y1','ĐH Y Dược.','','#');
